import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";

function Main(props){
    let lgt=useNavigate();
function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token')
    lgt('/');

 }

 var ctx = document.getElementById("myChart");

 var myChart = new Chart(ctx, {
   type: "line",
   data: {
     labels: [
       "Sunday",
       "Monday",
       "Tuesday",
       "Wednesday",
       "Thursday",
       "Friday",
       "Saturday",
     ],
     datasets: [
       {
         data: [15339, 21345, 18483, 24003, 23489, 24092, 12034],
         lineTension: 0,
         backgroundColor: "transparent",
         borderColor: "#007bff",
         borderWidth: 4,
         pointBackgroundColor: "#007bff",
       },
     ],
   },
   options: {
     scales: {
       yAxes: [
         {
           ticks: {
             beginAtZero: false,
           },
         },
       ],
     },
     legend: {
       display: false,
     },
   },
 });

 
    return(
        <div>
         
         <Header login='Logout'  nav={Logout}   sidebar='mySidebar' />

        </div>
    );
}

export default Main;
